import '../styles/tagList.css'

function Host (props){

    const FIRST_NAME = props.host.name.split(" ")[0];
    const LAST_NAME = props.host.name.split(" ")[1];
    console.log(FIRST_NAME)

    return(
        <div className="tagList">
            <div>
                <p>
                    {FIRST_NAME}
                </p>
                <p>
                    {LAST_NAME}
                </p>
            </div>
            <div>

            </div>
        </div>
    );

}

export default Host
